import React from 'react'
import TemperatureGraph from "./TemperatureGraphic/TemperatureGraph.js"

class Info extends React.Component {
    constructor(props){
      super(props)
      this.state = {
        selectedCities: []
      }
    }

    componentDidMount() {
        console.warn("num of cities ==> ", this.props.cities.length)
    }

    render() {
        if(this.props.cities.length > 2) {
            return (
                <div>
                    <TemperatureGraph />
                </div>
            )
        } else {
            return null
        }
    }
}
export default Info
